Generation 3 Glock 22C (these are the factory ported models, discontinued  during Gen 3) it has Trijicon Night Sights and a custom stippling job (not terribly aggressive) that enhances handling...factory barrel has had less than 300 rounds (all FMJ) down the pipe...cleaned after every range visit

Comes with (1) 10 round and (1) 15 round Magazine, Galco IWB holster and generic hard case...
for the right deal I can add in 100 rounds of FMJs  and possibly a Streamlight TRL-1 HL Weaponlight (almost brand new) ($130 extra for cash sale)
